‚†Ä
Pain relief‚†Ä
Our muscles are made for movement; they don't like it when they are held static for long periods of time. Sports massage can get those muscles moving; easing and softening; and making them more supple and relaxed.‚†Ä
‚†Ä
Working long, tiring hours at an office desk and worst still, working on a laptop can easily result in poor posture, rounded shoulders,  stiff neck and often a headache too.  As more people resort to working from a laptop, posture is further compromised. ‚†Ä
‚†Ä
SPORTS MASSAGE THERAPISTS RELIEVE STIFF, SORE, ACHING MUSCLES FOR ATHLETES, BUT HOW CAN THEY USE THIS TREATMENT FOR OFFICE WORKERS? ‚†Ä
‚†Ä
Sports massage is a deep tissue therapy which relaxes and realigns tense, tight tissues.  This technique is beneficial to everyone, not just sports people.‚†Ä
‚†Ä
BENEFITS OF SPORTS MASSAGE:‚†Ä
‚†Ä
1. PAIN RELIEF‚†Ä
Our muscles are made for movement; they don‚Äôt like it when they are held static for long periods of time. Sports massage can get those muscles moving; easing and softening; and making them more supple and relaxed.‚†Ä
‚†Ä
2. MOVEMENT/MOBILITY‚†Ä
Stiff neck and shoulders? Laptop users have poor desk ergonomic, which long term will cause pain.  Sports massage can restore movement and functionality in stiff and aching muscles. Your therapist can also provide you with exercises you can do throughout your day to maintain movement.‚†Ä
‚†Ä
3. STRESS RELIEF‚†Ä
Stress is prevalent in most people's lives.  It's how we deal with it that is of importance.  Many of us hold on to our stress in our body,  our muscles become tense, rigid and dysfunctional.  Sports massage can release the stress from your body, allowing it to feel 'lighter' allowing you to move more freely.‚†Ä
‚†Ä
4. PREVENTION OF FURTHER PAIN‚†Ä
A good sports massage therapist can teach you about your body, and the way it responds and interacts with your working environment. This can promote an understanding of how to prevent further pain.‚†Ä
